import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators, AbstractControl } from '@angular/forms';
import { Preferences } from '@capacitor/preferences';
import { RegionService } from '../service/region.service';
import { Region } from '../models/region.model';

@Component({
  selector: 'app-user-registration',
  templateUrl: './user-registration.page.html',
  styleUrls: ['./user-registration.page.scss'],
})

export class UserRegistrationPage implements OnInit {
  regiones: Region[] = [];
  regionSeleccionada: Region = { id: 0, nombre: '' };
  userForm: FormGroup; // Formulario reactivo para la validación
  hoverMessages: { [key: string]: string } = {};

  constructor(
    private regionService: RegionService,
    private formBuilder: FormBuilder
  ) {
    // Inicializa el formulario con validadores
    this.userForm = this.formBuilder.group({
      nombreUsuario: [
        '',
        [
          Validators.required,
          Validators.minLength(4),
          Validators.pattern(/^[a-zA-Z0-9]+$/),
        ],
      ],
      nombre: [
        '',
        [
          Validators.required,
          Validators.maxLength(50),
          Validators.pattern(/^[a-zA-Z0-9]+$/),
        ],
      ],
      apellido: [
        '',
        [
          Validators.required,
          Validators.maxLength(50),
          Validators.pattern(/^[a-zA-Z0-9]+$/),
        ],
      ],
      rut: [
        '',
        [
          Validators.required,
          Validators.pattern(/^\d{7,8}[kK]$/),
        ],
      ],
      correo: ['', [Validators.required, Validators.email]],
      telefono: [
        '',
        [
          Validators.required,
          Validators.pattern(/^\d{9}$/),
        ],
      ],
      direccion: ['', [Validators.required]],
      regionSeleccionada: ['', [Validators.required]],
      contrasena: [
        '',
        [
          Validators.required,
          Validators.minLength(8),
        ],
      ],
      repetirContrasena: [
        '',
        [
          Validators.required,
          Validators.minLength(8),
        ],
      ],
    });

    // Asigna los mensajes de ayuda para hover
    this.hoverMessages = {
      nombreUsuario: 'Campo obligatorio. Longitud mínima de 4 caracteres.',
      nombre: 'Campo obligatorio. Solo caracteres alfanuméricos, máximo 50.',
      apellido: 'Campo obligatorio. Solo caracteres alfanuméricos, máximo 50.',
      rut: 'Campo obligatorio. Formato ejemplo: 12345678k',
      correo: 'Campo obligatorio. Debe ser un correo electrónico válido.',
      telefono: 'Campo obligatorio. Debe tener exactamente 9 dígitos.',
      direccion: 'Campo obligatorio.',
      regionSeleccionada: 'Campo obligatorio.',
      contrasena: 'Campo obligatorio. Longitud mínima de 8 caracteres.',
      repetirContrasena: 'Campo obligatorio. Longitud mínima de 8 caracteres.',
    };
  }

  ngOnInit() {
    this.regionService.getRegiones().subscribe(response => {
      this.regiones = response.regiones;
      console.log(this.regiones);
    });
  }

  async guardarDatosEnPreferences() {
    try {
      // Comprueba la validez del formulario antes de guardar datos
      if (this.userForm.valid) {
        const datosUsuario = {
          key: 'usuario_' + this.userForm.value.nombreUsuario,
          value: JSON.stringify(this.userForm.value),
        };

        await Preferences.set(datosUsuario);

        console.log('Datos del usuario almacenados en Preferences correctamente');
      } else {
        console.error('Error: El formulario contiene campos no válidos');
      }
    } catch (error) {
      console.error('Error al almacenar datos del usuario en Preferences:', error);
    }
  }
}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>Registro de Usuario</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="ion-padding">
  <form [formGroup]="userForm" (ngSubmit)="guardarDatosEnPreferences()">
    <ion-item>
      <ion-label>Nombre de Usuario</ion-label>
      <ion-input type="text" formControlName="nombreUsuario"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Nombre</ion-label>
      <ion-input type="text" formControlName="nombre"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Apellido</ion-label>
      <ion-input type="text" formControlName="apellido"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>RUT</ion-label>
      <ion-input type="text" formControlName="rut"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Correo</ion-label>
      <ion-input type="email" formControlName="correo"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Teléfono</ion-label>
      <ion-input type="tel" formControlName="telefono"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Dirección</ion-label>
      <ion-input type="text" formControlName="direccion"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Seleccione región</ion-label>
      <ion-select placeholder="Seleccionar región" formControlName="regionSeleccionada">
        <ion-select-option *ngFor="let region of regiones" [value]="region">
          {{ region.nombre }}
        </ion-select-option>
      </ion-select>
    </ion-item>

    <ion-item>
      <ion-label>Contraseña</ion-label>
      <ion-input type="password" formControlName="contrasena"></ion-input>
    </ion-item>

    <ion-item>
      <ion-label>Repetir Contraseña</ion-label>
      <ion-input type="password" formControlName="repetirContrasena"></ion-input>
    </ion-item>

    <!-- Botón para almacenar datos del usuario en Preferences -->
    <ion-button type="submit" [disabled]="!userForm.valid">Guardar Datos del Usuario</ion-button>
  </form>
</ion-content>
